using System;
using System.Diagnostics;
using System.Drawing;
using System.Drawing.Drawing2D;
using System.IO;

namespace maplewookie {
	public class Character {
		public static Random rand = new Random();
		public const string Gdpath = "C:/gd";

		public int skin, face, hair;
		public int accface, acceye, accear;
		public int hat, cape, coat, glove, longcoat, pants, shoes;
		public int weapon, shield;

		public void Render(Graphics g, int x, int y) {
			g.SmoothingMode = SmoothingMode.None;
			g.InterpolationMode = InterpolationMode.NearestNeighbor;

			if (hair > 0)
				Cache.GetHair(hair).RenderBack(this, g, x, y);

			if (skin > 0)
				Cache.GetSkin(skin).RenderBody(g, x, y);

			if (shoes > 0 && Cache.GetShoes(shoes).z == 0)
				Cache.GetShoes(shoes).Render(g, x, y);

			if (pants > 0)
				Cache.GetPants(pants).Render(g, x, y);

			if (shoes > 0 && Cache.GetShoes(shoes).z == 1)
				Cache.GetShoes(shoes).Render(g, x, y);

			if (coat > 0)
				Cache.GetCoat(coat).RenderBody(g, x, y);

			if (skin > 0)
				Cache.GetSkin(skin).RenderHead(g, x, y);

			if (skin > 0)
				Cache.GetSkin(skin).RenderArm(g, x, y);

			if (coat > 0)
				Cache.GetCoat(coat).RenderArm(g, x, y);

			if (glove > 0)
				Cache.GetGloves(glove).RenderLeft(g, x, y);

			if (glove > 0)
				Cache.GetGloves(glove).RenderRight(g, x, y);

			if (accface > 0 && Cache.GetAccFace(accface).z == 0)
				Cache.GetAccFace(accface).Render(g, x, y);

			if (face > 0)
				Cache.GetFace(face).Render(g, x, y);

			if (accface > 0 && Cache.GetAccFace(accface).z == 1)
				Cache.GetAccFace(accface).Render(g, x, y);

			if (acceye > 0)
				Cache.GetAccFace(acceye).Render(g, x, y);

			if (hair > 0)
				Cache.GetHair(hair).RenderFront(this, g, x, y);
		}

		public static bool Between(int v, int bottom, int top) {
			return v >= bottom && v <= top;
		}

		public static bool IsMale(int id) {
			return Between(id, 20000, 20999) || Between(id, 30000, 30999) || Between(id, 33000, 33999);
		}

		public static bool IsFemale(int id) {
			return Between(id, 21000, 21999) || Between(id, 31000, 31999) || Between(id, 34000, 34999);
		}

		/// <summary>
		/// Generates a new character randomly
		/// </summary>
		/// <param name="gender">
		/// -1 == random face and hair
		///  0 == random gender,
		///  1 == male,
		///  2 == female
		/// </param>
		/// <returns></returns>
		public static Character Random(int gender) {
			if (gender == 0)
				gender = rand.Next(1, 3);

			do
				Shuffle(Ids.face);
			while (gender == 0 || (gender == 1 ? IsFemale(Ids.face[0]) : IsMale(Ids.face[0])));

			do
				Shuffle(Ids.hair);
			while (gender == 0 || (gender == 1 ? IsFemale(Ids.hair[0]) : IsMale(Ids.hair[0])));

			//top kek
			//code is actually a bit cleaner this way
			//i wonder how much time is actually spent shuffling these arrays
			Shuffle(Ids.accface);
			Shuffle(Ids.acceye);
			Shuffle(Ids.accear);
			Shuffle(Ids.coat);
			Shuffle(Ids.pants);
			Shuffle(Ids.shoes);
			Shuffle(Ids.glove);
			
			Character ret = new Character();
			int skinrand = rand.Next(0, 101);
			ret.skin = (skinrand > 96 ? 2002 : skinrand > 92 ? 2001 : 2000);
			ret.face = Ids.face[0];
			ret.hair = Ids.hair[0];
			if (rand.Next(0, 101) > 45) ret.accface = Ids.accface[0];
			if (rand.Next(0, 101) > 45) ret.acceye = Ids.acceye[0];
			ret.coat = Ids.coat[0];
			ret.pants = Ids.pants[0];
			if (rand.Next(0, 101) > 5) ret.shoes = Ids.shoes[0];
			if (rand.Next(0, 101) > 75) ret.glove = Ids.glove[0];
			return ret;
		}

		static void Shuffle<T>(T[] array) {
			int n = array.Length;
			for (int i = 0; i < n; i++) {
				int r = i + (int)(rand.NextDouble() * (n - i));
				T t = array[r];
				array[r] = array[i];
				array[i] = t;
			}
		}
	}

